@Xzisτance [τ, נ] SN41 Did the validators take into account the results of yesterday's matches in the Premier League?  
I don't see any changes in the number of predictions and points in their logs for EPL miners.
I think validators are having trouble getting the odds from the API to calculate the scores. Changes happen regularly in the NBA league

it's the same period that is used for calculating the ROI column in the table you just shared, so the same predictions window.
```
# Calculate the market ROI for the prediction
                    if pwmd.actualHomeTeamScore > pwmd.actualAwayTeamScore and pwmd.homeTeamOdds < pwmd.awayTeamOdds:
                        league_roi_market_payouts[league][index] += ROI_BET_AMOUNT * (pwmd.get_actual_winner_odds()-1)
                    elif pwmd.actualAwayTeamScore > pwmd.actualHomeTeamScore and pwmd.awayTeamOdds < pwmd.homeTeamOdds:
                        league_roi_market_payouts[league][index] += ROI_BET_AMOUNT * (pwmd.get_actual_winner_odds()-1)
                    elif pwmd.actualHomeTeamScore == pwmd.actualAwayTeamScore and pwmd.drawOdds < pwmd.homeTeamOdds and pwmd.drawOdds < pwmd.awayTeamOdds:
                        league_roi_market_payouts[league][index] += ROI_BET_AMOUNT * (pwmd.get_actual_winner_odds()-1)
                    else:
                        league_roi_market_payouts[league][index] -= ROI_BET_AMOUNT
```

@sportstensor・41 hotfix merged: https://github.com/sportstensor/sportstensor/pull/139
- Brings min_rho value down to `0.0025` which equates to roughly 2 days worth of games for all leagues. This allows EPL and MLS miners to earn incentive from one weekend's worth of games.
- Lowers min_roi value to `-20`. The previous values were too strict when attempting to push the quality requirement of miners.
